import { F, Flyde } from 'flyde';

type ObjectWithId = {
  id: string;
  [key: string]: any;
};

type Input = {
  map: { [id: string]: ObjectWithId };
};

type Output = {
  array: ObjectWithId[];
};

const transformMapToArray: F<Input, Output> = async (input, output) => {
  const { map } = input;
  const array = Object.values(map).filter(obj => obj.hasOwnProperty('id'));
  output.array = array;
};

const transformMapToArrayPart = new Flyde(transformMapToArray);

export default transformMapToArrayPart;
